//@ts-nocheck
import React from 'react';
import {Col, Panel, Row} from 'rsuite';
import PieDonutChart from './RadarChart';
import TinyBarChart from './TinyBarChart';


export type CardSection3Props={
  RadarData?:any
  PieDonutChartData?:any
  BarChartData?:any
  tinyBarChartData?:any
}


const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);

const CardSection3 = (props: CardSection3Props)=>{
  console.log("done")
return (
  <Row>
    <Col md={8} sm={12}>
      <Card  ><div style={{height:"500px"}}>
  <PieDonutChart
  PieDonutChartData={props?.PieDonutChartData}/>

        </div></Card>
    </Col>
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}>
        </div></Card>
    </Col>
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}>
        <TinyBarChart
        tinyBarChartData={props?.tinyBarChartData}/>
        </div>
        </Card>
    </Col>

  </Row>
);
}

export default CardSection3;
